import React from 'react';
import { Route } from 'react-router-dom';

import PreviewAllitemContainer from '../../components/preview_all_item_container/PreviewAllItemContainer';
import PreviewItemCategory from '../preview_item_category/PreviewItemCategory';

const ShopPage = props => {
  const { match } = props;
  return (
    <div className="shop-page">
      <Route exact path={`${match.path}`} component={PreviewAllitemContainer} />
      <Route path={`${match.path}/:categoryId`} component={PreviewItemCategory} />
    </div>
  );
};

export default ShopPage;
